import React from 'react'

export default function Flashcard( {flashcard }) {
    return (
        <div>
            <div className = "front">
                {flashcard.question}
                hoh\n
                <img src={flashcard.Image} alt="sd"/>;
                <div className = "card-options">
                    {
                        flashcard.options.map(option => {
                            return <div className="flashcard-option">{option}</div>
                        })
                    }
                </div>
            </div>
            <div className = "back">
                {flashcard.answer}
            </div>
        </div>
    )
}
